import React from 'react';
import Meme from './Meme';

class App extends React.Component{
	constructor(){
		super()
		this.state = {
			meme : Meme 
		}
	}

	render(){

		const list = this.state.meme.map((list) => {
				return(<h1>{list.quote}</h1>)
			})

		return(
		<div>
			{this.state.meme[1].quote}
		</div>
		)

	}

}

export default App;
